AMP_FiddlerScript:
    static function OnBeforeResponse(oSession: Session) {

        //see if we are on the right site and dealing with HTML.
        if (oSession.uriContains("qaMO.providentmetals.com") && oSession.oResponse.headers.ExistsAndContains("Content-Type","text/html")){

            // Remove any compression or chunking
                oSession.utilDecodeResponse();
                var oBody = System.Text.Encoding.UTF8.GetString(oSession.responseBodyBytes);
                
                // Create regex to capture the closing <body> tag.
                var endBodyRegEx = /(<\/\s*body(?:|\s+[^>]*)>)/gi;
                var scriptSrc = 'https://womp.me/js/ampEngine?SiteId=7825';
                var script_tag = '<script data-cfasync="false" id="WompAmpScript">';
                script_tag += "setTimeout(function(){";
                script_tag += " wompLib = null;";
                script_tag += " var script = document.createElement('script');";
                script_tag += " script.src = '" + scriptSrc + "';";
                script_tag += " script.setAttribute('crossorigin', 'anonymous');";
                script_tag += " document.getElementsByTagName('head')[0].appendChild(script);";
                script_tag += "}, 2000);";
                script_tag += " </script> ";
                
                // Inject the script tag before the end of the ending </body> tag.
                oBody = oBody.replace(endBodyRegEx, script_tag + "$1");
                    
                // Set the response body
                oSession.utilSetResponseBody(oBody);
            }
        }
